description:
Vegas, Baby!!! Everybody's favorite wallcrawler joins forces with power woman to neutralize an aim splinter cell in Sin City, when they cross paths with a new villain: Mysterio! Luckily, Arachne comes to the rescue... In more ways than one. Legendary director Axel Braun and adult powerhouse Vivid Entertainment proudly present the sequel to the award-winning sexy spoof that redefined the porn parody genre. Get ready for the ultimate swing!

Casey Calvert, Dani Daniels, Kylie Ireland, Nicki Hunter, Sarah Shevon, Veruca James, Giovanni Francesco, Xander Corvus

